import React, { Component } from "react";

class CB extends Component {
  state = {
    indxmap: {
      //static
      1: [2, 3, 4],
      2: [5, 6],
      3: [7, 8, 9],
      4: [10],
      5: [10],
      6: [10],
      7: [10],
      8: [10],
      9: [10]
    },
    sentmap: {
      //static
      1: "this is start 1",
      2: "under 1->2",
      3: "under 1->3",
      4: "under 1->4",
      5: "under 2->5",
      6: "under 2->6",
      7: "under 3->7",
      8: "under 3->8",
      9: "under 3->9",
      10: "call to executive"
    },
    idx: 1, //props
    user: 1, //props
    rembut: 0 //props
  };

  render() {
    return (
      <div>
        <p>{this.state.sentmap[this.state.idx]}</p>
        {this.state.indx[1].map(tags => (
          <li key={tags}>{this.state.sentmap[tags]}</li>
        ))}
        {this.printButtons()}
      </div>
    );
  }
  printButtons() {
    var ret;
    for (var i = 0; i < this.state.indxmap[this.state.idx].length; i++) {
      ret += (
        <button>
          {this.state.sentmap[this.state.indxmap[this.state.idx][i]]}
        </button>
      );
      console.log(this.state.sentmap[this.state.indxmap[this.state.idx][i]]);
    }
    console.log(ret);
    return ret;
  }
}

export default CB;
